import { getAllAsync } from "../redux/rickMortySlice"
import { useEffect } from "react"
import { useSelector, useDispatch } from "react-redux"

export const Episodes = () => {

  const { displayAllEpisodes } = useSelector(state => state.rickMorty)

  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(getAllAsync({ query: 'episode' }))
  }, [dispatch])

  return (
    <div>
    {console.log(displayAllEpisodes)}
    </div>
  )
}
